import React from "react";
import Swiper, { Parallax } from 'swiper';

// class ParallaxVerticalScrolling extends React.Component {
//   componentDidMount() {
//     new Swiper('.swiper-container', {
//       direction: 'vertical',
//       mousewheel: true,
//       parallax: true
//     });
//   }


function ProductName(props) {
  return (
    <div className="text-start text-6xl leading-tight ">
      <h1>{props.title}</h1>
    </div>
  );
}
function SubHeadingProduct(props) {
  return (
    <div className="text-start py-5 ">
      <h3>{props.text}</h3>
    </div>
  );
}
function ConsistOf(props) {
  return (
    <div className="text-start">
      <h3>{props.heding}</h3>
      <div className="text-center px-14 py-2">
        <p>{props.discription}</p>
      </div>
    </div>
  );
}


const Slider = () => {
  return (
    <>
      <Swiper
        spaceBetween={0}
        centeredSlides={true}
        autoplay={{
          delay: 5000,
          disableOnInteraction: false,
        }}
        pagination={{
          clickable: true,
        }}
        // grabCursor={true}
        // navigation={true}
        loop={true}
        modules={[Autoplay, Pagination, Navigation]}
        // onAutoplayTimeLeft={onAutoplayTimeLeft}
        className="mySwiper w-screen h-screen md:h-full">
        <SwiperSlide>
          <img src={imgOne} alt="imgOne" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={imgTwo} alt="imgTwo" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={imgThree} alt="imgThree" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={imgFour} alt="imgFour" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={imgFive} alt="imgFive" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={imgSix} alt="imgSix" />
        </SwiperSlide>

        {/* <div className="autoplay-progress" slot="container-end">
        <svg viewBox="" ref={progressCircle}>
          <circle cx="24" cy="24" r="20"></circle>
        </svg>
        <span ref={progressContent}></span>
        </div> */}
      </Swiper>

      <div className="flex flex-col">
      {/* text section */}
      <div className="container xl:w-1/2 sm:w-1/2 h-full justify-center items-center text-center p-16 bg-primaryTwo font-inder overflow-auto">
        {/* h1- Product Name */}
        <ProductName title={"Sustainability Starter Kit"} />
        {/* h3- Sub Heading */}
        <SubHeadingProduct
          text={"This starter kit is all you need to start the revolution."}
        />
        {/* h3 - consist*/}
        <ConsistOf
          heding={'Consist of : '}
          discription={"2 Bamboo Straws, 1 Plant Based Reusable Cup with 2 lids, 1 Natural Loofah, 1 box of 50 Bamboo Cotton Eartips, 1 Bamboo Toothbrush"}

        />
        {/* p - consist disciption*/}
        {/* h3- Features*/}
        <ConsistOf heding={"Features :"} discription={"Govt Approved, Tested, and approved in TUV Rhineland, Germany <br>100% recyclable and non-toxic Leak-Proof Odorless tasteless and doesnâ€™t react with hot beverages Lightweight Microwavable"} />
        {/* p - disciption*/}
        {/* button*/}
        <div className=" flex py-4 pr-16 justify-end items-end ">
          <button
            className="bg-white border-1 shadow-xl border-[#000000] hover:bg-[#D9D9D9] hover:text-primaryFour  text-black font-bold py-2 px-10 "
            w-10>
            Buy Now
          </button>
        </div>
      </div>
      {/* Img section */}
      <div className="">
        <img src="../assets/sl" alt="" />
      </div>
    </div></>

  );
};

export default Slider;
